    true,nt"url": null,nt"notes": "<p>Authors of Costs and Clinical Quality
    Among Medicare Beneficiaries - Associations with Health Center Penetration of Low-Income
    Residents, published in Volume 4, Issue 3 of Medicare and Medicaid Research Review,
     report analyses to determine if increased access to primary care by the underserved
    had any effect on Medicare spending and clinical quality. Using data on elderly
    Medicare beneficiaries across U.S. geographic healthcare markets (hospital referral
    regions, HRRs), data from federally funded health centers, and income data from
    the American Community Survey,  the authors calculated Medicare spending and clinical
    quality, and compared those outcomes in HRRs with high versus low health center
    penetration. HRRs with high penetration by health centers had 9.7 percent lower
    Medicare spending (926 dollars per person) than HRRs with low health center penetration,
    and no difference in clinical quality outcomes. High health center penetration among
    low-income populations may accrue Medicare cost savings without compromising clinical
    quality.</p>n",nt"license_title": "Other License Specified",nt"extras":
